import { Col} from "react-bootstrap";
const Card=(props)=>{
    return(

        props.array.list.slice(0,7).map((item , index)=>{
            return(
          
            <Col key={index} className=" col-1 shadow p-3 mb-4 bg-body-tertiary rounded">
        <h6>{index + 1}</h6>
        {(item.weather[0].description === "snow" || item.weather[0].description === "light snow")&& (
          <img
            src="data:image/jpeg;base64,"
            alt="snow"
            style={{ width: "50px", height: "50px" }}
          />
        )}
        
        {(item.weather[0].description === "few clouds"||item.weather[0].description==="scattered clouds"||item.weather[0].description==="overcast clouds") && (
            
            <img
              src="data:image/png;base64,"
              alt="snow"
              style={{ width: "50px", height: "50px" }}/>)}
        
        {item.weather[0].description === "clear sky" && (
            
            <img
              src="data:image/png;base64,"
              alt="snow"
              style={{ width: "50px", height: "50px" }}/>)}
        
        {item.weather[0].description === "light rain"  && (
                      <img
                        src="data:image/jpeg;base64,"
                        alt="snow"
                        style={{ width: "50px", height: "50px" }}
                      />
                    )}
        {item.weather[0].description === "broken clouds"  && (
                      <img
                        src="data:image/jpeg;base64,"
                        alt="snow"
                        style={{ width: "50px", height: "50px" }}
                      />
                    )}
        <h6>{item.weather[0].description}</h6>
        <h6>
          {(item.main.temp_max - 273.15).toFixed(1)}°/
          {(item.main.temp_min - 273.15).toFixed(1)}°
        </h6>
        </Col>)
    
        })
        
       
    )
}
export default Card

